`{{prefix}}setup` çalıştırdıktan sonra, kullanıcılar öneri gönderebilecektir ve bot çalışacaktır. Özel emojiler veya komutların otomatik temizlenmesi gibi gelişmiş ayarlamaları istiyorsanız, https://suggester.js.org/#/admin/config sayfasına göz atın.

Eğer bir sorun yaşıyorsan, veya bot hakkında daha çok şey bilmek istiyorsan, __Suggester destek sunucusu__na gelin: {{invite}}
Bu embed istenildiği zaman `{{prefix}}tutorial` kullanılarak gösterilebilir.
